  <template id="detail-content-zh-template"><p></p><p></p><p></p><p></p><p class=""><span style="caret-color: rgb(0, 0, 0); background-color: transparent; font-size: 0.95rem; color: rgb(0, 0, 0);">✨&nbsp;<span style="font-weight: bold;">CPLN 6920&nbsp; A+项目</span></span></p><p class=""><span style="background-color: transparent; font-size: 15.2px; caret-color: rgb(0, 0, 0); color: rgb(120, 120, 120);">项目概要：维京群岛位于加勒比海，洪水是其最常见也是最具有破坏性的自然灾害。</span><span style="background-color: transparent; font-size: 0.95rem; color: rgb(120, 120, 120); caret-color: rgb(0, 0, 0);">许多居民并不了解自己的洪水风险等级，或在紧急情况下如何避难。</span><span style="caret-color: rgb(0, 0, 0); background-color: transparent; font-size: 0.95rem; color: rgb(120, 120, 120);">该洪水风险看板是一款为居民设计的交互式数据可视化工具。其目标是同步政府预警信息给居民，从而帮助居民了解自身的洪水风险，查找附近的应急避难所，并获得个性化的洪水保险建议。</span></p><p></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 740px; height: 463px; overflow: visible;" data-ratio="0.6262" data-resizing="0"><img src="assets/1771480233353.jpg" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></div><p></p><p style="text-align: center;"><a class="detail-inline-link detail-inline-button" role="button" href="#jump-anchor-mlueeua4-gd3zd5" style="display: inline-flex; align-items: center; justify-content: center; box-sizing: border-box; text-decoration: none; vertical-align: middle; cursor: pointer; font-weight: 700; color: rgb(79, 128, 119); background: rgb(255, 255, 255); border-radius: 12px; border: 1px solid rgb(79, 128, 119); padding: 8px 16px;">立即体验demo</a><br></p><h1>1 背景</h1><p><span style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;">维京群岛</span><span style="color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium; caret-color: rgb(0, 0, 0); background-color: transparent;">位于加勒比海，长期受到飓风与气候变化的影响。由于岛屿地形陡峭，<b>洪水灾害频发，对居民财产造成巨大经济损失</b>。</span></p><blockquote><span style="font-size: medium;"><span style="color: rgb(120, 120, 120);"><span style="font-family: -webkit-standard; caret-color: rgb(0, 0, 0); background-color: transparent;">洪水易发：降雨量达到 4 英寸时发生洪水的概率高达 <span style="font-weight: bold;">92%</span><br></span></span><span style="color: rgb(120, 120, 120);"><span style="font-family: -webkit-standard; caret-color: rgb(0, 0, 0); background-color: transparent;">影响范围广：</span></span><span style="color: rgb(120, 120, 120); font-family: -webkit-standard; caret-color: rgb(0, 0, 0);">在 2017 年的飓风“厄玛”和“玛丽亚”中，<span style="font-weight: bold;">85% </span>的家庭报告其住宅受到损坏</span><span style="color: rgb(120, 120, 120);"><span style="font-family: -webkit-standard; caret-color: rgb(0, 0, 0); background-color: transparent;"><br></span></span><span style="background-color: transparent; font-family: -webkit-standard; caret-color: rgb(0, 0, 0); color: rgb(120, 120, 120);">经济损失大：</span><span style="color: rgb(120, 120, 120); font-family: -webkit-standard; caret-color: rgb(0, 0, 0); background-color: transparent;">飓风</span><span style="background-color: transparent; color: rgb(120, 120, 120); font-family: -webkit-standard; caret-color: rgb(0, 0, 0);">造成的经济损失估计约为 <span style="font-weight: bold;">112.5 亿美元</span></span></span></blockquote><p></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 600px; height: 344px; overflow: visible;" data-ratio="0.5725" data-resizing="0"><img src="assets/1771653850089.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></div><p></p><p style="text-align: center;" class="detail-note-text">图1 维京群岛地理区位图</p><p>尽管灾害频发，由于居住模式分散和政府资源有限等原因，居民个体需要对灾害做出充分准备。<span style="background-color: transparent; font-size: 0.95rem;">因此，</span><span style="background-color: transparent; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;">有必要构建一个<b>面向居民</b>的洪水风险信息与决策支持工具</span><span style="background-color: transparent; caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;">。</span></p><h1>2 需求分析</h1><p>通过调研，提炼出居民的核心需求集中在以下三点：</p><p></p><ol><li>我的房产有遭遇洪水的风险吗？</li><li>洪水来临的时候，我该如何避难？</li><li><span style="background-color: transparent; font-size: 0.95rem;">我如何将洪水灾害的损失降到最低？</span></li></ol><span style="background-color: transparent; font-size: 0.95rem;"><div><span style="background-color: transparent; font-size: 0.95rem;">这三个需求对应</span><b style="background-color: transparent; font-size: 0.95rem;">灾前的风险分析，灾中的应急避险，灾后的恢复重建</b><span style="background-color: transparent; font-size: 0.95rem;">三个阶段。</span></div></span><p></p><h1></h1><p></p><p></p><div><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 600px; height: 289px; overflow: visible;" data-ratio="0.4819" data-resizing="0"><img src="assets/1771653850102.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></div><p style="text-align: center;" class="detail-note-text">图2 居民需求收集</p></div><h1>3 产品设计</h1><h2><span style="color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium; caret-color: rgb(0, 0, 0); background-color: transparent;">3.1 界面设计</span></h2><p><span style="color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium; caret-color: rgb(0, 0, 0); background-color: transparent;">界面以地图为核心，强调直观与可操作性，帮助居民快速理解自身的洪水风险，并据此做出合理决策。</span><span style="color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium; caret-color: rgb(0, 0, 0); background-color: transparent;">面板<b>左侧</b>为交互式地图，集中展示不同等级的洪水分区信息。居民可以通过点击地图中的地块，或在搜索框中输入地块名称，快速定位并获取对应位置的风险评估结果。</span></p><p></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="overflow: visible; width: 600px; height: 344px;" data-ratio="0.5741" data-resizing="0"><img src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAC3wAAAaYCAYAAABmOj9UAAAAAXNSR0IArs4c6QAAAERlWElmTU0AKgAAAAgAAYdpAAQAAAABAAAAGgAAAAAAA6ABAAMAAAABAAEAAKACAAQAAAABAAALfKADAAQAAAABAAAGmAAAAAB4sCWNAABAAElEQVR4AezdB1QUVxsG4FcQQUQUO4ICiooNe++99z8m9prERBONmmKJMTFGY6KmGDUm0Rhj7LFr7L1ixd5FUVFRbAgo4H/v6q4LOzO7Cwus+N5zcGdum5lndxY857vfZNi4a9szsFCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoICqgFMskCFDBmTPnl33KjvKfWtL4jHPnimHcz98+FA3dUZPT09rj8H+FKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAVeK4HUDvh2c3PT+WbMmjXrawXNi6UABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoYK2APuBbxl/rs3TrX62ZK/EYtQzf+jkd9Bt8pQAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAfsSYMC3fb0fPBsKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAgYBBnwbKLhBAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUMC+BDLa1+nwbChAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKvPoCjx8/xu3bt3Hv3j1ER0frLsjFxQUeHh7InTs3XF1dLbpIBnxbxMROFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAXMCzx79gwhISEICwsz6RwVFaUL/r5x4wby5MkDX19fZMiQwaSfcQUDvo01uE0BClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQIIkCMtj71KlTePDggdkZbt26pQv+DggI0Az6djA7EztQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKCAWYHLly9bFOytn0gGhsts4FqFAd9aOmyjAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKGCBwOPHj3Hz5k0LeibsEhYWBjlWrTDgW02G9RSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFLBS4ffu2hT1Nu2mNZcC3qRdrKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpYJRAREWFVf+POWmMZ8G0sxW0KUIACFKAABShAAQpQgAIUoAAFKEABClCAAhSgAAUoQAEKUIACFKAABShAAQpQgAIUoAAFKEABClCAAkkQiI6OTsK png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></div><p style="text-align: center;" class="detail-note-text">图4 三个信息板块：“<span style="font-size: 0.86rem; background-color: transparent;">风险等级分析”，“最近的紧急庇护”，以及“保险购买建议”</span></p><h2 style="text-align: left;"><span style="background-color: transparent;"><font size="3">3.2 预警流程</font></span></h2><p style="text-align: left;" class=""><span style="background-color: transparent;"><font size="3">接到灾害预警后，政府部门将根据最新的气象数据进行分析，并将分析结果导入面板。政府将发布相关预警信息，居民点击进入面板了解自己所在区域的风险和防灾建议，从而为防灾做出准备。</font></span></p><p style="text-align: left;" class=""><span style="background-color: transparent;"><font size="3"></font></span></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 800px; height: 416px; overflow: visible;" data-ratio="0.5195" data-resizing="0"><font size="3"><img src="assets/1771794739577.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></font></div><p></p><p class="detail-note-text" style="text-align: center;">图5 面板使用的流程</p><p class="" style="text-align: left;">整体设计以“少负担、强指引”为原则，将复杂的专业数据转化为<b>可理解、可执行</b>的行动信息。同时支持桌面/手机双端，以及英语、西班牙语和中文三种语言，提供适用性广阔的使用场景。</p><p><span style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;"></span></p><p class="detail-note-text"></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 600px; height: 395px; overflow: visible;" data-ratio="0.6575" data-resizing="0"><img src="assets/1771794739604.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></div><p style="text-align: center;" class="detail-note-text"><span style="font-size: 13.76px;">图6 多端的应用场景</span></p><p></p><h1 id="jump-anchor-mlueeua4-gd3zd5" data-line-jump-anchor-id="jump-anchor-mlueeua4-gd3zd5">4 产品Demo展示</h1><p>支持语言：英语，西班牙语，中文</p><p>支持桌面端和移动端</p><p></p><div class="image-wrapper web-preview-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" data-ratio="0.6250" data-web-preview-src="https://cenjinheng.github.io/dashboard-project/" data-web-preview-type="external" style="width: 1100px; height: 675px; overflow: hidden;" data-resizing="0"><div class="web-preview-placeholder"><p class="web-preview-placeholder-note">请点击下方的预览按钮查看插入效果</p><a class="web-preview-placeholder-link" href="https://cenjinheng.github.io/dashboard-project/" target="_blank" rel="noopener noreferrer">查看链接的网页</a></div></div><p></p><p style="text-align: center;"><a class="detail-inline-link detail-inline-button" role="button" href="https://cenjinheng.github.io/dashboard-project/" target="_blank" rel="noopener noreferrer" style="display: inline-flex; align-items: center; justify-content: center; box-sizing: border-box; text-decoration: none; vertical-align: middle; cursor: pointer; font-weight: 700; color: rgb(29, 28, 26); background: rgb(255, 255, 255); border-radius: 12px; border: 1px solid rgb(29, 28, 26); padding: 8px 16px;">跳转到展示网页</a><br></p><p style="text-align: center;" class="detail-note-text"><br></p><p style="text-align: center;" class="detail-note-text">项目由劲衡设计和开发</p><p style="text-align: center;" class="detail-note-text">Designed and developed by Jinheng</p><p style="text-align: center;" class="detail-note-text">@2025</p></template>
  <template id="detail-content-en-template"><p></p><p></p><p></p><p></p><p class=""><span style="caret-color: rgb(0, 0, 0); background-color: transparent; font-size: 0.95rem; color: rgb(0, 0, 0);">✨&nbsp;<span style="font-weight: bold;">CPLN 6920&nbsp; A+Project</span></span></p><p class="detail-note-text"><span style="background-color: transparent; font-size: 15.2px; caret-color: rgb(0, 0, 0);"><font color="#787878">Abstract: The U.S. Virgin Islands are located in the Caribbean, where flooding is one of the most frequent and destructive natural disasters. Many residents are unaware of their flood risk levels or how to seek shelter in emergency situations. The Flood Risk Dashboard is an interactive data visualization tool designed for residents. Its goal is to deliver government warning information to residents in a timely manner, helping them understand their flood risk, locate nearby emergency shelters, and receive personalized flood insurance recommendations.</font></span></p><p></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 740px; height: 463px; overflow: visible;" data-ratio="0.6262" data-resizing="0"><img src="assets/1771480233353.jpg" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></div><p></p><p style="text-align: center;"><a class="detail-inline-link detail-inline-button" role="button" href="#jump-anchor-mlueeua4-gd3zd5" style="display: inline-flex; align-items: center; justify-content: center; box-sizing: border-box; text-decoration: none; vertical-align: middle; cursor: pointer; font-weight: 700; color: rgb(79, 128, 119); background: rgb(255, 255, 255); border-radius: 12px; border: 1px solid rgb(79, 128, 119); padding: 8px 16px;">Try Product Demo</a><br></p><h1>1 Introduction</h1><p><span style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;">The U.S. Virgin Islands are located in the Caribbean and have long been affected by hurricanes and climate change. Due to the islands’ steep terrain, <b>flooding occurs frequently, causing significant economic losses to residents’ properties.</b></span></p><blockquote><font color="#787878" face="-webkit-standard" size="3"><span style="caret-color: rgb(0, 0, 0);"><b>High Flood Risk:</b> When rainfall reaches 4 inches, the probability of flooding is as high as <b>92%</b>.<br></span></font><span style="caret-color: rgb(0, 0, 0); color: rgb(120, 120, 120); font-family: -webkit-standard; font-size: medium; background-color: transparent;"><b>Wide Impact:</b> During Hurricanes Irma and Maria in 2017, <b>85%</b> of households reported damage to their homes.<br><b>Severe Economic Losses:</b> The economic losses caused by the hurricanes are estimated at approximately <b>$11.25 billion</b>.</span></blockquote><p></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 600px; height: 344px; overflow: visible;" data-ratio="0.5725" data-resizing="0"><img src="assets/1771653850089.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></div><p></p><p style="text-align: center;" class="detail-note-text">Pic 1. Location of the US Virgin Island</p><p>Despite the high frequency of disasters, <b>residents must take primary responsibility for preparedness</b> due to dispersed settlement patterns and limited government resources. Therefore, it is necessary to develop a flood risk information and decision-support tool for residents.</p><h1>2 Needs analysis</h1><p data-start="33" data-end="95" style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);">Through research, I identified three core needs of residents:</p><ol><li data-start="97" data-end="140"><p data-start="99" data-end="140"><span data-start="99" data-end="138">Is my property at risk of flooding?</span></p></li><li data-start="141" data-end="192"><p data-start="143" data-end="192"><span data-start="143" data-end="190">Where should I seek shelter during a flood?</span></p></li><li data-start="193" data-end="246"><p data-start="195" data-end="246"><span data-start="195" data-end="246">How can I minimize losses from flood disasters?</span></p></li></ol><p data-start="248" data-end="420" data-is-last-node="" data-is-only-node="" style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);">These three needs correspond to three stages:<span class="Apple-converted-space">&nbsp;</span><strong data-start="294" data-end="324">pre-disaster risk analysis</strong>,<span class="Apple-converted-space">&nbsp;</span><strong data-start="326" data-end="368">emergency response during the disaster</strong>, and<span class="Apple-converted-space">&nbsp;</span><strong data-start="374" data-end="419">post-disaster recovery and reconstruction</strong>.</p><p></p><h1></h1><p></p><p></p><div><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 600px; height: 289px; overflow: visible;" data-ratio="0.4819" data-resizing="0"><img src="assets/1771653850102.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></div><p style="text-align: center;" class="detail-note-text">Pic 2.Collections of Residents' Needs</p></div><h1>3 Product Design</h1><h2><span style="color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium; caret-color: rgb(0, 0, 0); background-color: transparent;">3.1 UI design</span></h2><p><span style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;">The interface is centered around a map, emphasizing clarity and usability to help residents quickly understand their flood risk and make informed decisions. The <b>left</b> panel features an interactive map that displays flood zones by risk level. Residents can click on parcels on the map or enter a parcel name in the search box to quickly locate a property and view the corresponding risk assessment results.</span></p><p></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="overflow: visible; width: 600px; height: 335px;" data-ratio="0.5575" data-resizing="0"><img src="assets/1771797106963.png" alt="" draggable="false" style="object-fit: contain; width: 100%; height: 100%; position: relative; left: 0px; top: 0px;"></div><p></p><p style="text-align: center;" class="detail-note-text">Pic 3.UI of the dashboard</p><p><span style="color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium; caret-color: rgb(0, 0, 0); background-color: transparent;">On the <b>right</b>, t</span><span style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;">he three information panels provide a structured interpretation of the selected parcel, including <b>the risk level analysis, the nearest shelters with route navigation, and risk management and insurance recommendations</b> tailored to the user’s individual risk profile.</span></p><p></p><table class="detail-table"><tbody><tr><td><b>Needs</b></td><td><span style="font-weight: bold;">Functions</span></td></tr><tr><td><span style="font-size: 15.2px; background-color: transparent;">Is my property at risk of flooding?</span></td><td><strong data-start="34" data-end="58" style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);">Risk Level Analysis:</strong><span style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;"><span class="Apple-converted-space">&nbsp;</span>The flood risk level of a resident’s area is calculated by integrating elevation data, weather data, and hydrological flow simulations.</span></td></tr><tr><td><span style="font-size: 15.2px; background-color: transparent;">Where should I seek shelter during a flood?</span></td><td><strong data-start="27" data-end="57" style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);">Nearest Emergency Shelter:</strong><span style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;"><span class="Apple-converted-space">&nbsp;</span>Identify the closest shelter and provide route planning.</span></td></tr><tr><td><span style="font-size: 15.2px; background-color: transparent;">How can I minimize losses from flood disasters?</span></td><td><strong data-start="34" data-end="70" style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0);">Flood Insurance Recommendations:</strong><span style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;"><span class="Apple-converted-space">&nbsp;</span>Provide insurance purchase strategies based on property value.</span></td></tr></tbody></table><p style="text-align: center;" class="detail-note-text">Table 1.Transition from needs to functions</p><p></p><p class="detail-note-text"></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 800px; height: 351px; overflow: visible;" data-ratio="0.4385" data-resizing="0"><img src="assets/1771653850106.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></div><p style="text-align: center;" class="detail-note-text">Pic 4.The three info panels on the right:Risk level analysis; Nearest emergency shelter; flood insurance recommendations</p><h2 style="text-align: left;"><span style="background-color: transparent;"><font size="3">3.2&nbsp;</font></span><span style="color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium; caret-color: rgb(0, 0, 0); background-color: transparent;">Alert Workflow</span></h2><p style="text-align: left;" class=""><span style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;">After a disaster warning is issued, government agencies analyze the latest meteorological data and import the results into the dashboard. The government then releases relevant alerts, and residents can click through to the dashboard to understand the risks in their area and review preparedness recommendations, enabling them to prepare for potential disasters.</span></p><p style="text-align: left;" class=""><span style="background-color: transparent;"><font size="3"></font></span></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 800px; height: 416px; overflow: visible;" data-ratio="0.5195" data-resizing="0"><font size="3"><img src="assets/1771794739577.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></font></div><p></p><p class="detail-note-text" style="text-align: center;">Pic 5.Alert process</p><p class="" style="text-align: left;"><span style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;">The overall design transforms complex professional data into information that is easy to understand and act upon. The system supports both desktop and mobile devices, as well as three languages, providing broad applicability across different use scenarios.</span></p><p><span style="caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: -webkit-standard; font-size: medium;"></span></p><p class="detail-note-text"></p><div class="image-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" style="width: 600px; height: 395px; overflow: visible;" data-ratio="0.6575" data-resizing="0"><img src="assets/1771794739604.png" draggable="false" alt="" style="width: 100%; height: 100%; object-fit: contain; position: relative; left: 0px; top: 0px;"></div><p style="text-align: center;" class="detail-note-text"><span style="font-size: 13.76px;">Pic 6.broad applicability</span></p><p></p><h1 id="jump-anchor-mlueeua4-gd3zd5" data-line-jump-anchor-id="jump-anchor-mlueeua4-gd3zd5">4 Product demo</h1><p>Support languages: English, Spanish, and Chinese</p><p>Support Platforms: Desktop and Mobile</p><p></p><div class="image-wrapper web-preview-wrapper align-center" contenteditable="false" draggable="true" data-lock-ratio="true" data-cropped="false" data-ratio="0.6250" data-web-preview-src="https://cenjinheng.github.io/dashboard-project/" data-web-preview-type="external" style="width: 1100px; height: 675px; overflow: hidden;" data-resizing="0"><div class="web-preview-placeholder"><p class="web-preview-placeholder-note">请点击下方的预览按钮查看插入效果</p><a class="web-preview-placeholder-link" href="https://cenjinheng.github.io/dashboard-project/" target="_blank" rel="noopener noreferrer">查看链接的网页</a></div></div><p></p><p style="text-align: center;"><a class="detail-inline-link detail-inline-button" role="button" href="https://cenjinheng.github.io/dashboard-project/" target="_blank" rel="noopener noreferrer" style="font-size: 0.86rem; display: inline-flex; align-items: center; justify-content: center; text-decoration-line: none; vertical-align: middle; cursor: pointer; font-weight: 700; color: rgb(29, 28, 26); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border-radius: 12px; border: 1px solid rgb(29, 28, 26); padding: 8px 16px;">Redirect to the page</a></p><p style="text-align: center;" class="detail-note-text">Designed and developed by Jinheng</p><p style="text-align: center;" class="detail-note-text">@2025</p></template>
